INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 0.0, 2, 0.0, 401, "アヤネ", 102301, 10046, 24001, 0.0, 2, 24, "2020/07/31 12:00:00", "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 2.21, 1, 0.0, 402, "アヤネ", 102301, 10046, 24002, 0.0, 2, 24, "2020/07/31 12:00:00", "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 0.0, 2, 0.0, 403, "アヤネ", 102301, 10046, 24003, 0.0, 2, 24, "2020/07/31 12:00:00", "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 1.99, 2, 0.0, 701, "アサヒ", 192201, 10046, 24004, 0.0, 1, 24, "2020/07/31 12:00:00", "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 2.21, 1, 0.0, 702, "アサヒ", 192201, 10046, 24005, 0.0, 2, 24, "2020/07/31 12:00:00", "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 3.33, 2, 0.0, 703, "アサヒ", 192201, 10046, 24006, 0.0, 1, 24, "2020/07/31 12:00:00", "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 0.0, 2, 0.0, 801, "部員３", 192301, 10046, 24007, 0.0, 2, 24, "2020/07/31 12:00:00", "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 2.68, 1, 0.0, 802, "部員３", 192301, 10046, 24008, 0.0, 2, 24, "2020/07/31 12:00:00", "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 0.0, 2, 0.0, 803, "部員３", 192301, 10046, 24009, 0.0, 2, 24, "2020/07/31 12:00:00", "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 0.0, 1, 0.0, 501, "", 192501, 10046, 24010, 0.0, 1, 24, "2020/07/31 12:00:00", "やった！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 0.0, 1, 0.0, 502, "", 192501, 10046, 24011, 0.0, 1, 24, "2020/07/31 12:00:00", "勝ったよ！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 0.0, 1, 0.0, 503, "", 192501, 10046, 24012, 0.0, 1, 24, "2020/07/31 12:00:00", "いい調子！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 5.33, 6, 0.0, 111, "ミサト", 113501, 10046, 24013, 0.0, 2, 24, "2020/07/31 12:00:00", "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 6.85, 1, 0.0, 112, "ミサト", 113501, 10046, 24014, 0.0, 2, 24, "2020/07/31 12:00:00", "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 3.0, 1, 0.0, 113, "ミサト", 113501, 10046, 24015, 0.0, 2, 24, "2020/07/31 12:00:00", "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 6.11, 1, 0.0, 611, "ダイチ", 192401, 10046, 24016, 0.0, 2, 24, "2020/07/31 12:00:00", "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 6.75, 1, 0.0, 612, "ダイチ", 192401, 10046, 24017, 0.0, 2, 24, "2020/07/31 12:00:00", "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 0.0, 2, 0.0, 613, "ダイチ", 192401, 10046, 24018, 0.0, 2, 24, "2020/07/31 12:00:00", "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 4.52, 2, 0.0, 211, "ハツネ", 113401, 10046, 24019, 0.0, 1, 24, "2020/07/31 12:00:00", "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 3.89, 2, 0.0, 212, "ハツネ", 113401, 10046, 24020, 0.0, 1, 24, "2020/07/31 12:00:00", "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 13.49, 1, 0.0, 213, "ハツネ", 113401, 10046, 24021, 0.0, 2, 24, "2020/07/31 12:00:00", "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 3.17, 1, 0.0, 311, "カヤ", 106501, 10046, 24022, 0.0, 2, 24, "2020/07/31 12:00:00", "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 4.42, 1, 0.0, 312, "カヤ", 106501, 10046, 24023, 0.0, 2, 24, "2020/07/31 12:00:00", "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 2.89, 6, 0.0, 313, "カヤ", 106501, 10046, 24024, 0.0, 1, 24, "2020/07/31 12:00:00", "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 3.71, 4, 0.0, 421, "アヤネ", 102301, 10046, 24025, 0.0, 3, 24, "2020/07/31 12:00:00", "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 5.1, 2, 0.0, 721, "アサヒ", 192201, 10046, 24026, 0.0, 1, 24, "2020/07/31 12:00:00", "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 4.34, 1, 0.0, 821, "部員３", 192301, 10046, 24027, 0.0, 3, 24, "2020/07/31 12:00:00", "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 0.0, 1, 0.0, 521, "", 192501, 10046, 24028, 0.0, 1, 24, "2020/07/31 12:00:00", "いい勝負だったよ\nまたやろうね");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 5.62, 1, 0.0, 101, "ミサト", 113501, 10046, 24029, -360.0, 2, 24, "2020/07/31 12:00:00", "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 9.58, 1, 0.0, 102, "ミサト", 113501, 10046, 24030, -360.0, 2, 24, "2020/07/31 12:00:00", "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 0.0, 2, 0.0, 103, "ミサト", 113501, 10046, 24031, -360.0, 2, 24, "2020/07/31 12:00:00", "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 9.13, 2, 0.0, 104, "ミサト", 113501, 10046, 24032, -360.0, 1, 24, "2020/07/31 12:00:00", "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 8.27, 1, 0.0, 105, "ミサト", 113501, 10046, 24033, -360.0, 2, 24, "2020/07/31 12:00:00", "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！");
